import{_ as e,c as s,o,a as t}from"./app.928dab02.js";const g=JSON.parse('{"title":"Node.js \u5165\u95E8","description":"","frontmatter":{"layout":"doc","title":"Node.js \u5165\u95E8"},"headers":[{"level":2,"title":"Node.js\u662F\u4EC0\u4E48\uFF1F","slug":"node-js\u662F\u4EC0\u4E48\uFF1F","link":"#node-js\u662F\u4EC0\u4E48\uFF1F","children":[]},{"level":2,"title":"\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09","slug":"\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09","link":"#\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09","children":[]},{"level":2,"title":"\u5E94\u7528\u7A0B\u5E8F","slug":"\u5E94\u7528\u7A0B\u5E8F","link":"#\u5E94\u7528\u7A0B\u5E8F","children":[]}],"relativePath":"backend/Node.js/index.md","lastUpdated":1687271949000}'),r={name:"backend/Node.js/index.md"},n=t('<h1 id="node-js-\u5165\u95E8" tabindex="-1">Node.js \u5165\u95E8 <a class="header-anchor" href="#node-js-\u5165\u95E8" aria-hidden="true">#</a></h1><h2 id="node-js\u662F\u4EC0\u4E48\uFF1F" tabindex="-1">Node.js\u662F\u4EC0\u4E48\uFF1F <a class="header-anchor" href="#node-js\u662F\u4EC0\u4E48\uFF1F" aria-hidden="true">#</a></h2><p>Node.js\u662F\u4E00\u79CD\u57FA\u4E8EChrome V8 JavaScript\u5F15\u64CE\u6784\u5EFA\u7684\u5F00\u6E90\u670D\u52A1\u5668\u7AEF<strong>\u8FD0\u884C\u73AF\u5883</strong>\u3002\u5B83\u5141\u8BB8\u5F00\u53D1\u8005<strong>\u4F7F\u7528JavaScript\u7F16\u5199</strong>\u670D\u52A1\u5668\u7AEF\u5E94\u7528\u7A0B\u5E8F\uFF0C\u4ECE\u800C\u5B9E\u73B0<strong>\u5728\u670D\u52A1\u5668\u7AEF\u8FD0\u884CJavaScript\u4EE3\u7801</strong>\u7684\u80FD\u529B\u3002</p><h2 id="\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09" tabindex="-1">\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09 <a class="header-anchor" href="#\u4F18\u52BF\uFF08\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60\u5B83\uFF1F\uFF09" aria-hidden="true">#</a></h2><p>Node.js\u63D0\u4F9B\u4E86\u8BB8\u591A\u4F18\u52BF\uFF0C\u4F7F\u5F97\u5B83\u6210\u4E3AWeb\u5F00\u53D1\u7684\u7406\u60F3\u9009\u62E9\u3002\u4EE5\u4E0B\u662F\u4E00\u4E9B\u4F7F\u7528Node.js\u8FDB\u884CWeb\u5F00\u53D1\u7684\u4F18\u52BF\uFF1A</p><p><strong>\u9AD8\u6548\u7684I/O\u5904\u7406</strong>\uFF1ANode.js\u91C7\u7528\u5F02\u6B65I/O\u6A21\u578B\u548C\u4E8B\u4EF6\u9A71\u52A8\u7F16\u7A0B\uFF0C\u4F7F\u5F97\u5B83\u80FD\u591F\u5904\u7406\u9AD8\u5E76\u53D1\u7684\u8BF7\u6C42\uFF0C\u5177\u6709\u51FA\u8272\u7684I/O\u6027\u80FD\u548C\u54CD\u5E94\u901F\u5EA6\u3002</p><p><strong>\u53EF\u4F38\u7F29\u6027</strong>\uFF1ANode.js\u7684\u5355\u7EBF\u7A0B\u6A21\u578B\u548C\u4E8B\u4EF6\u5FAA\u73AF\u673A\u5236\u4F7F\u5F97\u5B83\u53EF\u4EE5\u8F7B\u677E\u5730\u5B9E\u73B0\u6C34\u5E73\u6269\u5C55\uFF0C\u5373\u901A\u8FC7\u6DFB\u52A0\u66F4\u591A\u7684\u670D\u52A1\u5668\u8282\u70B9\u6765\u6269\u5C55\u5E94\u7528\u7A0B\u5E8F\u7684\u5BB9\u91CF\u3002</p><p><strong>\u8DE8\u5E73\u53F0</strong>\uFF1ANode.js\u53EF\u4EE5\u5728\u591A\u4E2A\u5E73\u53F0\u4E0A\u8FD0\u884C\uFF0C\u5305\u62ECWindows\u3001Linux\u3001Mac OS X\u7B49\u3002\u8FD9\u4F7F\u5F97\u5F00\u53D1\u8005\u53EF\u4EE5\u4F7F\u7528\u76F8\u540C\u7684\u4EE3\u7801\u548C\u5DE5\u5177\u5728\u4E0D\u540C\u7684\u5E73\u53F0\u4E0A\u5F00\u53D1\u548C\u90E8\u7F72\u5E94\u7528\u7A0B\u5E8F\u3002</p><p><strong>\u5F3A\u5927\u7684\u5305\u7BA1\u7406\u5668</strong>\uFF1ANode.js\u9644\u5E26\u4E86\u4E00\u4E2A\u5F3A\u5927\u7684\u8F6F\u4EF6\u5305\u7BA1\u7406\u5668\uFF08npm\uFF09\uFF0C\u5B83\u662F\u4E16\u754C\u4E0A\u6700\u5927\u7684\u5F00\u6E90\u5E93\u751F\u6001\u7CFB\u7EDF\u4E4B\u4E00\uFF0C\u63D0\u4F9B\u4E86\u6570\u4EE5\u4E07\u8BA1\u7684\u5DE5\u5177\u548C\u6A21\u5757\uFF0C\u53EF\u4EE5\u5E2E\u52A9\u5F00\u53D1\u8005\u5FEB\u901F\u6784\u5EFA\u5E94\u7528\u7A0B\u5E8F\u3002</p><p><strong>\u57FA\u4E8EJavaScript</strong>\uFF1ANode.js\u4F7F\u7528JavaScript\u4F5C\u4E3A\u5F00\u53D1\u8BED\u8A00\uFF0C\u8FD9\u4F7F\u5F97\u524D\u7AEF\u5F00\u53D1\u8005\u53EF\u4EE5\u5728\u540E\u7AEF\u5F00\u53D1\u4E2D\u4F7F\u7528\u76F8\u540C\u7684\u8BED\u8A00\u548C\u6280\u672F\u6808\uFF0C\u4ECE\u800C\u66F4\u5BB9\u6613\u5730\u5B66\u4E60\u548C\u638C\u63E1\u3002</p><p><strong>\u5F3A\u5927\u7684\u793E\u533A\u652F\u6301</strong>\uFF1ANode.js\u6709\u4E00\u4E2A\u5E9E\u5927\u7684\u5F00\u53D1\u8005\u793E\u533A\uFF0C\u63D0\u4F9B\u4E86\u4E30\u5BCC\u7684\u6587\u6863\u3001\u6559\u7A0B\u3001\u5DE5\u5177\u548C\u6A21\u5757\uFF0C\u53EF\u4EE5\u5E2E\u52A9\u5F00\u53D1\u8005\u5FEB\u901F\u5165\u95E8\u5E76\u89E3\u51B3\u95EE\u9898\u3002</p><p>\u603B\u7684\u6765\u8BF4\uFF0CNode.js\u63D0\u4F9B\u4E86\u9AD8\u6548\u3001\u53EF\u4F38\u7F29\u3001\u8DE8\u5E73\u53F0\u3001\u6613\u4E8E\u5B66\u4E60\u548C\u4F7F\u7528\u7684\u7279\u6027\uFF0C\u4F7F\u5F97\u5B83\u6210\u4E3AWeb\u5F00\u53D1\u4E0D\u53EF\u6216\u7F3A\u7684\u4E00\u90E8\u5206\uFF0C\u88AB\u8D8A\u6765\u8D8A\u591A\u7684\u4F01\u4E1A\u548C\u7EC4\u7EC7\u91C7\u7528\u3002</p><h2 id="\u5E94\u7528\u7A0B\u5E8F" tabindex="-1">\u5E94\u7528\u7A0B\u5E8F <a class="header-anchor" href="#\u5E94\u7528\u7A0B\u5E8F" aria-hidden="true">#</a></h2><p>\u4EE5\u4E0B\u662F\u4E00\u4E9B\u5E38\u89C1\u7684\u5E94\u7528\u7A0B\u5E8F\u793A\u4F8B\uFF1A</p><p><strong>Netflix</strong>\uFF1ANetflix\u662F\u4E00\u5BB6\u77E5\u540D\u7684\u5728\u7EBF\u89C6\u9891\u6D41\u5A92\u4F53\u670D\u52A1\u63D0\u4F9B\u5546\uFF0C\u5B83\u7684\u7F51\u7AD9\u548C\u5BA2\u6237\u7AEF\u5E94\u7528\u7A0B\u5E8F\u90FD\u662F\u57FA\u4E8ENode.js\u6784\u5EFA\u7684\u3002Netflix\u4F7F\u7528Node.js\u6784\u5EFA\u4E86\u8BB8\u591A\u670D\u52A1\uFF0C\u5305\u62EC\u89C6\u9891\u7F16\u7801\u3001\u8D1F\u8F7D\u5747\u8861\u3001API\u670D\u52A1\u5668\u7B49\u7B49\u3002</p><p><strong>LinkedIn</strong>\uFF1ALinkedIn\u662F\u4E00\u5BB6\u793E\u4EA4\u7F51\u7EDC\u548C\u804C\u4E1A\u62DB\u8058\u5E73\u53F0\uFF0C\u5B83\u7684\u7F51\u7AD9\u548C\u79FB\u52A8\u5E94\u7528\u7A0B\u5E8F\u90FD\u662F\u57FA\u4E8ENode.js\u6784\u5EFA\u7684\u3002LinkedIn\u4F7F\u7528Node.js\u6784\u5EFA\u4E86\u8BB8\u591A\u670D\u52A1\uFF0C\u5982\u5B9E\u65F6\u901A\u77E5\u3001\u6D88\u606F\u63A8\u9001\u3001\u641C\u7D22\u5F15\u64CE\u7B49\u7B49\u3002</p><p><strong>Uber</strong>\uFF1AUber\u662F\u4E00\u5BB6\u77E5\u540D\u7684\u51FA\u884C\u670D\u52A1\u5E94\u7528\u7A0B\u5E8F\uFF0C\u5B83\u7684\u540E\u7AEF\u670D\u52A1\u4E5F\u662F\u57FA\u4E8ENode.js\u6784\u5EFA\u7684\u3002Uber\u4F7F\u7528Node.js\u6784\u5EFA\u4E86\u8BB8\u591A\u670D\u52A1\uFF0C\u5982\u5B9E\u65F6\u4F4D\u7F6E\u8DDF\u8E2A\u3001\u652F\u4ED8\u5904\u7406\u3001\u53F8\u673A\u914D\u5BF9\u7B49\u7B49\u3002</p><p><strong>PayPal</strong>\uFF1APayPal\u662F\u4E00\u5BB6\u5168\u7403\u9886\u5148\u7684\u5728\u7EBF\u652F\u4ED8\u670D\u52A1\u63D0\u4F9B\u5546\uFF0C\u5B83\u7684\u7F51\u7AD9\u548C\u79FB\u52A8\u5E94\u7528\u7A0B\u5E8F\u4E5F\u662F\u57FA\u4E8ENode.js\u6784\u5EFA\u7684\u3002PayPal\u4F7F\u7528Node.js\u6784\u5EFA\u4E86\u8BB8\u591A\u670D\u52A1\uFF0C\u5982\u652F\u4ED8\u5904\u7406\u3001\u6B3A\u8BC8\u68C0\u6D4B\u3001\u4EA4\u6613\u8BB0\u5F55\u7B49\u7B49\u3002</p><p><strong>NASA</strong>\uFF1ANASA\u662F\u7F8E\u56FD\u56FD\u5BB6\u822A\u7A7A\u822A\u5929\u5C40\uFF0C\u5B83\u7684\u4E00\u4E9B\u5E94\u7528\u7A0B\u5E8F\u4E5F\u662F\u57FA\u4E8ENode.js\u6784\u5EFA\u7684\u3002NASA\u4F7F\u7528Node.js\u6784\u5EFA\u4E86\u4E00\u4E9B\u670D\u52A1\uFF0C\u5982\u6570\u636E\u5206\u6790\u3001\u5B9E\u65F6\u76D1\u63A7\u7B49\u7B49\u3002</p><hr><p>\u4E8E\u662F\uFF0C\u5728\u95F2\u7A7A\u65F6\u95F4\u628AThe Net Ninja \u7684 Node.js Crash Course \u770B\u4E86\u4E00\u904D\uFF0C\u5728\u8FD9\u91CC\u505A\u4E00\u4E9B\u7B14\u8BB0\u3002</p><p>\u5B66\u4E60\u8D44\u6599\uFF1A The Net Ninja - <a href="https://www.youtube.com/watch?v=zb3Qk8SG5Ms&amp;list=PL4cUxeGkcC9jsz4LDYc6kv3ymONOKxwBU&amp;index=1" target="_blank" rel="noreferrer">Node.js Crash Course</a></p>',22),a=[n];function d(i,p,c,N,l,h){return o(),s("div",null,a)}const _=e(r,[["render",d]]);export{g as __pageData,_ as default};
